import styled from 'styled-components';

const Faq = () => {
    return (
        <>
            <FaqContainer>
                <div className="container-fluid">
                    <div className="row">
                        <h1>Frequently Asked Questions</h1>
                    </div>
                </div>
            </FaqContainer>
        </>
    )
}

const FaqContainer = styled.div`

`

export default Faq
